def cyc(f):
    a, b, c, t = symbols('a, b, c, t', positive = True)
    return f.subs(c, t).subs(b, c).subs(a, b).subs(t, a)

def sum_cyc(f):
    f1 = cyc(f)
    return f + f1 + cyc(f1)

